import React, { useState } from 'react';
import { Nav, Navbar } from 'react-bootstrap'

import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import Home from "./home.js";
import Stuff from "./textfiles.js";

const EtIDNav = () => (
<>

<HashRouter>
<Navbar bg="dark" vSettingsSettingsariant="dark" sticky="top" >
<Navbar.Brand href="/home">
  <img
    alt=""
    src="/logo.svg"
    width="30"
    height="30"
    className="d-inline-block align-top"
  />{' '}
  Eth-ter-I-Die
  </Navbar.Brand>
  <Nav className="mr-auto">
  <Nav.Link href="/home">Home</Nav.Link>
  <Nav.Link href="/textfiles">The Files</Nav.Link>
  </Nav>
</Navbar>
</HashRouter>

</>

);


export default EtIDNav;
